import React from 'react'

const Hero = ({ title, description }) => {
  return (
    <>
      <div className="bg-image mt-2 mb-5">
        <h1 className="mb-0">{title}</h1>
        <p>{description}</p>
      </div>
    </>
  )
}

export default Hero
